import { Fragment } from "react";
import styles from "./app.modules.css";

function HomePage() {
  return (
    <Fragment>
      <h1>All Cops Are Bastards.</h1>
      <div className={styles.mainBox}>
        <p>
          Lorem ipsum dolor amet ramps cronut mlkshk stumptown lyft viral 8-bit.
          Direct trade everyday carry kinfolk you probably haven't heard of them
          snackwave vape. Flannel lyft austin hell of green juice man bun
          drinking vinegar art party vape iPhone coloring book. Tote bag yuccie
          truffaut artisan umami quinoa, subway tile vice knausgaard cornhole
          neutra franzen irony health goth PBR&B. Schlitz raw denim subway tile
          four dollar toast, meditation lyft wolf slow-carb deep v actually
          church-key poutine. Blue bottle cloud bread paleo gluten-free, edison
          bulb you probably haven't heard of them actually. Tattooed marfa tbh
          lyft squid pabst try-hard.
        </p>
      </div>
    </Fragment>
  );
}

export default HomePage;
